package arrayx;

public class MutidimentionalArr {

	public static void main(String[] args) {
		// TODO Auto-generated method 
		String[][] names=new String[2][3];
		for(int row=0;row<2;row++) {
			for(int col=0;col<3;col++){
				System.out.print(" "+names[row][col]);
				
			}
			System.out.println("");
		}

	}

}
